import React, { useEffect, useState } from "react";
import './propertyCartApi.css';

const PropertyCart = () => {

    const [showCart, setShowCart] = useState([]);

    // Show Property Cart
    const propertyCart = () => {
        console.log("CART...!");
        return (
            <React.Fragment>
                {
                    <div>
                        showCart.map((item,index)=>(
                        <React.Fragment key={index} >
                            <div className="cart row">
                                {
                                    item.image.map((item, index) => (
                                        <React.Fragment key={index}>
                                            <img src={item} alt={item} ></img>
                                        </React.Fragment>
                                    ))
                                }
                            </div>
                        </React.Fragment>
                        ))
                    </div>
                }
            </React.Fragment>
        )
    }

    const cartImage = (API) => {
        fetch('http://localhost:3333/realestate/cartimage')
            .then(async (res) => {
                const cart = await res.json();
                return cart;
            })
            .then((cart) => {
                console.log("Image data : ", cart.data);
                setShowCart(cart.data);
            })
            .catch((err) => {
                console.log("Cart image: ", err.message);
            })
    }

    useEffect((e) => {
        cartImage();
    }, [])

    return (
        <React.Fragment>
            {propertyCart()}
        </React.Fragment>
    )
}

export default PropertyCart;
